import React from "react";
import SheepCounter from "./SheepCounter";

class SheepImg extends React.Component {
  render() {
    return (
      <img
        width="35px"
        src="http://www.clker.com/cliparts/e/4/8/7/13280460782141411990Cartoon%20Sheep.svg.hi.png"
        alt="sheep-cartoon"
      />
    );
  }
}

export default SheepImg;
